import { styled } from 'styled-components';

export const CommentContainer = styled.section`
    padding: 10px;
    display: flex;
    flex-direction: column;
    flex-wrap: wrap;
    justify-content: center;
    align-items: center;
    box-shadow: 4px 4px 4px 0px rgba(140, 140, 140, 0.25);
`

export const Comment = ({data}) => {
    return (
        <CommentContainer>
            this is comment
        </CommentContainer>
    );
};
